In a typical concurrency regime, like async/await, programs can "opt in" to asynchrony in specific spots. Additionally, special functionality like Promise.all(...) is necessary to express the idea that an operation should wait for multiple prior operations to complete before it can begin. Denim takes a very different approach: in Denim, concurrency is a first-class syntactic concern. Firstly, all operations in Denim are "awaited" automatically. When you don't need to wait for something to complete, you can let in complete without blocking using the async keyword. quick_operation_1(); // We wait for `quick_operation_1` to complete before starting
// `quick_operation_2` without having to use a keyword - just works.
quick_operation_2(); let eventual_value = super_slow_operation().async;
thing_that_needs_to_happen_right_away(); print("it's ready now: ${eventual_value.await}"); Secondly, and perhaps most importantly, Denim allows the programmer to ergonomically stipulate which things should happen at the same time, and which should happen in sequence. Statements separated a blank line are executed in sequence. let greeting = "hello"; // Performs a network call to figure out what planet we are on.
let planet = get_current_planet(); // Waits for a 3 second time to elapse.
wait_for_3_seconds(); // Nothing is printed to the screen until 3 seconds **after** `planet` is
// fetched.
print("$greeting, $planet!"); Statements not separated by a blank line are executed concurrently. let greeting = "hello";
let planet = get_current_planet();
wait_for_3_seconds(); // We print the moment all 3 of the statements in the previous group complete.
print("$greeting, $planet!"); The result is a terse yet readable way to sequence asynchronous logic.

