In many lanuages, lots of the good stuff is only usable when invoking a function as a member of a thing. Take for instance ?. in JavaScript. const foo = Math.random() > 0.5 ? { bar() {} } : null; foo?.doSomethingMaybe(); // this is dope function baz(foo) { // ...
} // I need this grossness to **safely** call `foo`:
if (foo) { baz(foo);
} This seems silly. ?. is one example of the fact that we humans love to create sequential, causal chains of things to do. Breaking these chains with control flow like if does not feel good. Denim is designed to make "chaining" operations as ergonomic. In a sense, Denim takes Rust's .await syntactic concept to its logical conclusion: let's make everything that can be used as a "prefix" usable as a "suffix". fn baz(foo: Foo, scalar = 1.0) -> double { // ... scalar * 123
} foo.baz(foo: it, scalar: 2.0).if it < 200 { print("it is $it!")
} Denim accomplishes a language feature called "fluency" by: Allowing control flow keywords to be suffixed like .try and .if Supporting the it keyword which is the value of the preceding expression in the "chain"

