Denim is designed to make library APIs easy on the eyes. It accomplishes this via two language quirks: Functions with zero arguments may be invoked without a trailing () This allows functions to behave like properties, encapsulating complexity the same way getters do in other languages. fn forty_two() -> int { 42 } fn ten(to_the_power_of = 1.0) -> int { (10 ** to_the_power_of).round() } print(forty_two * ten) // Prints "420" Functions can have a special parameter block of type fn() -> T that adds aesthetically pleasing syntax sugar \ fn foo(a: string, block: fn() -> string) -> string { "a $block"
} foo("hello") { foo("darkness") { "my old friend" }
}

