} add(1) // compiles add(1, 2) // does not compile
add(a: 1, b: 2) // compiles When all you need is positional arguments, consider a tuple or array. fn add(nums: (int, int?)) -> int { nums.0 + (nums.1 ?? 0)
} add((1, 2)) // compiles

